class PatientReport {
    constructor(firstname, lastname, sex, birthday, injury,) {
        this.firstname = firstname;
        this.lastname = lastname;
        this.sex = sex;
        this.birthday = birthday;
        this.injury = injury;
        this.doctor = getAssignedDoctor(injury);
    }

    getAssignedDoctor(injury) {
        return "Dr. " + "Jerry";
    }
}
